import React from 'react';

class AboutPage extends React.Component {
  render(){
    return <div className="AboutPage">
    You can say what you like, but I am telling you right now?
    Sheldon is the man! Awesome! I mean - you should see his
    mobile art - it's... it's really something!
    </div>
  }

}

export default AboutPage;
